import React from "react";
import {BrowserRouter as Router, Routes, Route} from 'react-router-dom';
//import './App.css';
import Registration  from "./pages/Registration";


function App() {

  return (
    <Router>
      <h2>Hello World!!</h2>
      <Routes>
        <Route path = "/"  element = {<Registration/>} />;
      </Routes>
    </Router>
  );
}

export default App;
